import { FieldName, ResourceType, ToOne, ToMany } from '../utils/generics'
import { JsonApiRoot, RelationshipMode } from '../utils/constants'

type PrimitiveAttributeType = 'string' | 'number' | 'boolean'

export class ResourceField {
  name: FieldName
  root: JsonApiRoot | null = null
  description: string

  constructor(name: FieldName, description: string) {
    this.name = name
    this.description = description
  }

  validate(value: any): boolean {
    return value !== undefined
  }
}

export class IdentifierField extends ResourceField {
  constructor(name: FieldName) {
    super(name, `a resource ${name}`)
  }
}

export class AttributeField extends ResourceField {
  readonly root = JsonApiRoot.ATTRIBUTES
  readonly required: boolean

  constructor(name: FieldName, description: string, required: boolean) {
    super(name, description)
    this.required = required
  }

  validate(value: any) {
    return (this.required === false && value === null) || value !== null
  }
}

export class PrimitiveAttributeField extends AttributeField {
  readonly type: PrimitiveAttributeType

  constructor(
    name: FieldName,
    type: PrimitiveAttributeType,
    required: boolean,
  ) {
    super(name, `a value of type ${type}`, required)
    this.type = type
  }

  validate(value: any): boolean {
    return super.validate(value) && typeof value === this.type
  }
}

export class RelationshipField extends ResourceField {
  readonly root = JsonApiRoot.RELATIONSHIPS
  readonly type: ResourceType
  readonly mode: ToOne | ToMany

  constructor(name: FieldName, type: ResourceType, mode: RelationshipMode) {
    super(name, `a ${mode}-relationship with Resource of type ${type}`)
    this.type = type
    this.mode = mode
  }
}
